class Solution {
    func count(_ num1: String, _ num2: String, _ min_sum: Int, _ max_sum: Int) -> Int {
        let mod = 1_000_000_007

        func digitSum(_ x: Int) -> Int {
            var sum = 0, x = x
            while x > 0 {
                sum += x % 10
                x /= 10
            }
            return sum
        }

        func countGood(_ num: String) -> Int {
            let n = Int(num)!
            var count = 0
            for i in 1...n {
                let sum = digitSum(i)
                if sum >= min_sum && sum <= max_sum {
                    count = (count + 1) % mod
                }
            }
            return count
        }

        let count1 = countGood(num1)
        let count2 = countGood(num2)
        let total = (count2 - count1 + mod) % mod
        var adjustment = 0
        for i in stride(from: Int(num1)! - 1, through: 0, by: -1) {
            let sum = digitSum(i)
            if sum >= min_sum && sum <= max_sum {
                adjustment = (adjustment + 1) % mod
            }
        }
        return (total + adjustment) % mod
    }
}
